import {
  createTheme,
  ThemeProvider,
  CssBaseline,
  Box,
} from "@mui/material/styles";

const theme = createTheme({
  palette: {
    primary: {
      light: "#f9bb36",
      main: "#fe913e",
      dark: "#353b3c",
      contrastText: "#fff",
    },
    secondary: {
      light: "#a3b4ff",
      main: "#222e64",
      dark: "#353b3c",
      contrastText: "#000",
    },
  },
});

export function Background() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div style={{ background: theme.palette.primary.main, height: "100vh" }}>
        {/* Your content goes here */}
      </div>
    </ThemeProvider>
  );
}
